    public void checkStringPreambleOnly(Fractal frac, String expected){
        try {
            // write the given frac to a file; we're going to check its contents.
            frac.write("out.txt");

            // the expected contents are in s1.
            Scanner scExp = new Scanner (expected);

            // the actual contents are read back from the file we just tried
            // to write, hopefully.
            Scanner scAct = new Scanner (readFile("out.txt"));

            // load the numbers into arrays for each version, however many there are.
            ArrayList<Double> arrExp = new ArrayList<Double>();
            ArrayList<Double> arrAct = new ArrayList<Double>();

            // load up the expected values from the expected string (header info) and the grid of values.
            int count = 0;
            while (scExp.hasNextDouble() && count<9){
                arrExp.add(scExp.nextDouble());
                count++;
            }

            count=0;
            // load up up to nine values from the written file.
            while (scAct.hasNextDouble() && count<9){
                arrAct.add(scAct.nextDouble());
                count++;
            }

            // check that the two array lists have the same items.
            assertArrayEquals(arrExp.toArray(),arrAct.toArray());
        }
        catch (Exception e) {
            throw  new AssertionError("file probably not written!");
        }
    }

